/**
 * Convert a SVG path into an SVG icon
 * @name Icon
 * @param {string} className
 * @param {string} fill
 * @param {string} height
 * @param {string} iconName
 * @param {string} title
 * @param {string} viewBox
 * @param {string} width
 * @return {JSX.Element}
 */
const Icon = ({
    className = "",
    fill = "",
    height = 20,
    iconName,
    title = "",
    viewBox = "0 0 1024 1024",
    width = 20
}) => {
    const iconTitle = title || iconName;
    if (Array.isArray(icons[iconName])) {
        const complexIcon = icons[iconName];
        return (
            <svg width={width} height={height} viewBox={viewBox} aria-labelledby={iconName} className={className}>
                <title id={iconName}>{iconTitle}</title>
                {complexIcon.map((value, index) => {
                    const uniqueKey = `path-${index}`;
                    return <path key={uniqueKey} fill={value.fill} d={value.d} />;
                })}
            </svg>
        );
    }
    return (
        <svg aria-labelledby={iconName} className={className} height={height} width={width} viewBox={viewBox}>
            <title id={iconName}>{iconTitle}</title>
            <path fill={fill} d={icons[iconName]} />
        </svg>
    );
};

Icon.propTypes = {
    className: PropTypes.string,
    fill: PropTypes.string,
    height: PropTypes.number,
    iconName: PropTypes.string.isRequired,
    title: PropTypes.string,
    viewBox: PropTypes.string,
    width: PropTypes.number
};

export default Icon;
